De film vertelt het waargebeurde verhaal van een man die de Afro-Amerikaanse kinderen van Washington D.C. iets kan geven wat ze nooit hebben gehad: een toekomst. Na 18 jaar in de gevangenis te hebben gezeten, begint Eugene Brown (Cuba Gooding Jr.) in 1991 de 'Big Chair Chess Club' om de kinderen van de straat te houden en te werken aan hun toekomst.


